import React, { Component } from 'react';
import RecipeReviewCard from './card';
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        <RecipeReviewCard></RecipeReviewCard>
      </div>
    );
  }
}

export default App;
